create table if not exists apple_sales_quantity_by_month
(
    sales_date date,
    brand      varchar(25),
    quantity   integer
);



create table if not exists apple_sales_revenue_by_month
(
    sales_date date,
    brand      varchar(25),
    revenue    numeric(10, 2)
);




create table if not exists employee
(
    employee_id integer     not null
        primary key,
    last_name   varchar(20) not null,
    first_name  varchar(20) not null,
    department  varchar(10),
    title       varchar(30),
    hire_date   date,
    salary      numeric(10, 2)
);






create table if not exists phone_sales_by_month
(
    sales_date date,
    brand      varchar(250),
    model      varchar(250),
    quantity   integer,
    unit_price numeric(10, 2)
);


create table if not exists tbl_bikeshare
(
    start_date           timestamp,
    end_date             timestamp,
    duration             integer,
    start_station_number integer,
    start_station        varchar(64),
    end_station_number   integer,
    end_station          varchar(64),
    bike_number          varchar(6),
    member_type          varchar(6)
);


